import React, { Component } from 'react';
import './NavBar.css'
class NavBar extends Component{

    render(){
        return(
            <React.Fragment>
            <div id='neon-logo'>
                <p>PhiNet</p>
            </div>
        </React.Fragment>
        )
    }

};

export default NavBar;
